import { useNavigate } from "react-router-dom";
import { useState } from "react";
import "../register.css";

const RegisterPage = () => {
  const navigate = useNavigate();

  function Header() {
    return (
      <header>
        <h2>AeroParker</h2>
      </header>
    );
  }

  function SubmitForm() {
    const [email, setEmail] = useState('');
    const [title, setTitle] = useState('Mr');
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [addressLine1, setAddressLine1] = useState('');
    const [addressLine2, setAddressLine2] = useState('');
    const [city, setCity] = useState('');
    const [postcode, setPostcode] = useState('');
    const [phoneNumber, setPhoneNumber] = useState('');

    let handleSubmit = async (e) => {
      e.preventDefault();

      

      try {
        await fetch("https://localhost:8080/api/v1/aeroparker/user", {
          method: "POST",
          headers: {
            "content-type": "application/json",
          },
          body: JSON.stringify({
            // email: formData.email,
            // title: formData.title,
            // firstName: formData.firstName,
            // lastName: formData.lastName,
            // addressLine1: formData.addressLine1,
            // addressLine2: formData.addressLine2,
            // city: formData.city,
            // postcode: formData.postcode,
            // phoneNumber: formData.phoneNumber,
          }),
        })
          .then((response) => {
            if (response.status === 201) {
                navigate("/success")
            }
          })
          
      } catch (err) {
        console.log(err);
      }
    };

    return (
      <form onSubmit={(e) => handleSubmit(e)}>
        <div className="form-group">
          <label>Email</label>
          <input
            className="inputText"
            id="Email"
            type="email"
            placeholder="Email"
            required
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            
          />
          
        </div>

        <div className="form-group">
          <label>Title</label>
          <select
          value={title}
          onChange={(e) => setTitle(e.target.value)}>
            <option>Mr</option>
            <option>Mrs</option>
            <option>Miss</option>
            <option>Ms</option>
            <option>Sir</option>
            <option>Dr</option>
          </select>
        </div>

        <div className="form-group">
          <label>First name</label>
          <input
            className="inputText"
            id="FirstName"
            type="text"
            placeholder="First name"
            required
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
          />
        </div>

        <div className="form-group">
          <label>First name</label>
          <input
            className="inputText"
            id="LastName"
            type="text"
            placeholder="Last name"
            required
            value={lastName}
            onChange={(e) }
          />
          {formErrors.lastName && (
            <span className="error">{formErrors.lastName}</span>
          )}
        </div>

        <div className="form-group">
          <label>Address Line 1</label>
          <input
            className="inputText"
            id="AddressLine1"
            type="text"
            placeholder="Address line 1"
            // value={formData.addressLine1}
            onChange={handleChange}
          />
          {formErrors.addressLine1 && (
            <span className="error">{formErrors.addressLine1}</span>
          )}
        </div>

        <div className="form-group">
          <label>Address Line 2</label>
          <input
            className="inputText"
            id="AddressLine2"
            type="text"
            placeholder="Address line 2 (optional)"
            // value={formData.addressLine2}
            onChange={handleChange}
          />
          {formErrors.addressLine2 && (
            <span className="error">{formErrors.addressLine2}</span>
          )}
        </div>

        <div className="form-group">
          <label>City</label>
          <input
            className="inputText"
            id="City"
            type="text"
            placeholder="City (optional)"
            // value={formData.city}
            onChange={handleChange}
          />
          {formErrors.city && <span className="error">{formErrors.city}</span>}
        </div>

        <div className="form-group">
          <label>Postcode</label>
          <input
            className="inputText"
            id="Postcode"
            type="text"
            placeholder="Postcode"
            // value={formData.postcode}
            onChange={handleChange}
          />
          {formErrors.postcode && (
            <span className="error">{formErrors.postcode}</span>
          )}
        </div>

        <div className="form-group">
          <label>Phone number</label>
          <input
            className="inputText"
            id="AddressLine1"
            type="text"
            placeholder="Phone number"
            // value={formData.phoneNumber}
            onChange={handleChange}
          />
          {formErrors.phoneNumber && (
            <span className="error">{formErrors.phoneNumber}</span>
          )}
        </div>

        <div id="onSuccess"></div>

        <input
          className="inputLogin"
          type="submit"
          value={"Register"}
          onClick={() => {
            document.getElementById("onSuccess").innerHTML = "Loading...";
          }}
        />
      </form>
    );
  }

  return (
    <div>
      <Header />
      <SubmitForm />
    </div>
  );
};

export default RegisterPage;
